'price': 4.34,
"percentage": "5%",
"change": 0.33,},
]);

const [finalArr, setFinalArr] = useState([])



  return (
    <main>
      <BearRow downerStocks={downerStocks}/>
      <BullRow upperStocks={upperStocks}/>
    </main>
  );
};

export default MainContainer;
